import{_ as t,c as i,o as a,ag as s}from"./chunks/framework.-kPtTt-D.js";const p=JSON.parse('{"title":"Release History","description":"","frontmatter":{},"headers":[],"relativePath":"server/releases.md","filePath":"server/releases.md"}'),n={name:"server/releases.md"};function r(o,e,d,l,c,h){return a(),i("div",null,[...e[0]||(e[0]=[s('<h1 id="release-history" tabindex="-1">Release History <a class="header-anchor" href="#release-history" aria-label="Permalink to &quot;Release History&quot;">​</a></h1><p>This page documents Queen MQ server releases and their compatible client versions.</p><h2 id="version-compatibility-matrix" tabindex="-1">Version Compatibility Matrix <a class="header-anchor" href="#version-compatibility-matrix" aria-label="Permalink to &quot;Version Compatibility Matrix&quot;">​</a></h2><table tabindex="0"><thead><tr><th>Server Version</th><th>Description</th><th>Compatible Clients</th></tr></thead><tbody><tr><td><strong>0.12.9</strong></td><td>Fixed server crash (SIGSEGV) on lease renewal, added EdDSA/JWKS auth, fixed examples</td><td>JS ≥0.7.4, Python ≥0.7.4, 0.12.0 if needs to use</td></tr><tr><td><strong>0.12.8</strong></td><td>Added single partition move to now to frontend</td><td>JS ≥0.7.4, Python ≥0.7.4, 0.12.0 if needs to use</td></tr><tr><td><strong>0.12.7</strong></td><td>Optimized cg metadata creation for new consumer groups</td><td>JS ≥0.7.4, Python ≥0.7.4, 0.12.0 if needs to use</td></tr><tr><td><strong>0.12.6</strong></td><td>Improved slow cg discovery when there are tons of partitions</td><td>JS ≥0.7.4, Python ≥0.7.4, 0.12.0 if needs to use</td></tr><tr><td><strong>0.12.5</strong></td><td>Fixed cg lag calculation for &quot;new&quot; cg at first message</td><td>JS ≥0.7.4, Python ≥0.7.4, 0.12.0 if needs to use</td></tr><tr><td><strong>0.12.4</strong></td><td>Fixed window buffer debounce behavior</td><td>JS ≥0.7.4, Python ≥0.7.4, 0.12.0 if needs to use proxy auth</td></tr><tr><td><strong>0.12.3</strong></td><td>Added JWT authentication</td><td>JS ≥0.7.4, Python ≥0.7.4, 0.12.0 if needs to use proxy auth</td></tr><tr><td><strong>0.12.x</strong></td><td>New frontend and docs</td><td>JS ≥0.7.4, Python ≥0.7.4, 0.12.0 if needs to use proxy auth</td></tr><tr><td><strong>0.11.x</strong></td><td>Libqueen 0.11.0; added stats tables and optimized analytics procedures, added DB statement timeout and stats reconcile interval</td><td>JS ≥0.7.4, Python ≥0.7.4</td></tr><tr><td><strong>0.10.x</strong></td><td>Total rewrite of the engine with libuv and stored procedures, removed streaming engine</td><td>JS ≥0.7.4, Python ≥0.7.4</td></tr><tr><td><strong>0.8.x</strong></td><td>Added Shared Cache with UDP sync for clustered deployment</td><td>JS ≥0.7.4, Python ≥0.7.4</td></tr><tr><td><strong>0.7.5</strong></td><td>First stable release</td><td>JS ≥0.7.4, Python ≥0.7.4</td></tr></tbody></table><h2 id="bug-fixing-and-improvements" tabindex="-1">Bug fixing and improvements <a class="header-anchor" href="#bug-fixing-and-improvements" aria-label="Permalink to &quot;Bug fixing and improvements&quot;">​</a></h2><ul><li>Server 0.12.9: Fixed server crash (SIGSEGV) on lease renewal caused by use-after-free of HttpRequest pointer</li><li>Server 0.12.9: Added native EdDSA and JWKS JWT authentication (auto-discovery via JWT_JWKS_URL)</li><li>Server 0.12.9: Fixed quickstart consumer example (autoAck + onError silent conflict)</li><li>Server 0.12.9: Fixed examples 03-transactional-pipeline.js and 08-consumer-groups.js (missing .each())</li><li>Server 0.12.8: Added single partition move to now to frontend</li><li>Server 0.12.7: Optimized cg metadata creation for new consumer groups</li><li>Server 0.12.6: Improved slow cg discovery when there are tons of partitions</li><li>Server 0.12.5: Fixed cg lag calculation for &quot;new&quot; cg at first message</li><li>Server 0.12.4: Fixed window buffer debounce behavior</li><li>Clients 0.12.1: Fixed bug in transaction with consumer groups</li></ul><h2 id="release-details" tabindex="-1">Release Details <a class="header-anchor" href="#release-details" aria-label="Permalink to &quot;Release Details&quot;">​</a></h2><h3 id="version-0-12-9" tabindex="-1">Version 0.12.9 <a class="header-anchor" href="#version-0-12-9" aria-label="Permalink to &quot;Version 0.12.9&quot;">​</a></h3><p><strong>Highlights:</strong></p><ul><li><strong>Fixed server crash (SIGSEGV):</strong> The lease renewal endpoint (<code>/api/v1/lease/:leaseId/extend</code>) captured the uWebSockets <code>HttpRequest*</code> pointer inside an async body callback, causing a use-after-free when the body arrived. This crash was triggered by clients using <code>renewLease()</code> with any interval. Fixed by extracting URL parameters synchronously before the async body read.</li><li><strong>Native EdDSA and JWKS authentication:</strong> Added support for EdDSA (Ed25519) JWT tokens and automatic JWKS key discovery. Configure with <code>JWT_ENABLED=true</code>, <code>JWT_ALGORITHM=auto</code> (or <code>EdDSA</code> for strict mode), and <code>JWT_JWKS_URL</code> pointing to your JWKS endpoint. This replaces the experimental <code>-exp-jwks</code> build and is now part of the main release.</li><li><strong>Fixed documentation and examples:</strong> Fixed the quickstart Step 4 consumer example where <code>.autoAck(true)</code> combined with <code>.onError()</code> silently disabled auto-acknowledgment. Fixed <code>03-transactional-pipeline.js</code> and <code>08-consumer-groups.js</code> examples that were missing <code>.each()</code> before <code>.consume()</code>, causing handlers to receive arrays instead of single messages.</li></ul><p><strong>Compatible Clients:</strong></p><ul><li>JavaScript Client: <code>queen-mq</code> &gt;=0.7.4</li><li>Python Client: <code>queen-mq</code> &gt;=0.7.4</li></ul><h3 id="version-0-12-0" tabindex="-1">Version 0.12.0 <a class="header-anchor" href="#version-0-12-0" aria-label="Permalink to &quot;Version 0.12.0&quot;">​</a></h3><p><strong>Highlights:</strong></p><ul><li>New frontend and docs, new stats and fixed some issues</li></ul><h3 id="version-0-11-0" tabindex="-1">Version 0.11.0 <a class="header-anchor" href="#version-0-11-0" aria-label="Permalink to &quot;Version 0.11.0&quot;">​</a></h3><p><strong>Highlights:</strong></p><ul><li>Libqueen 0.11.0; added stats tables and optimized analytics procedures, added DB statement timeout and stats reconcile interval</li></ul><p><strong>Compatible Clients:</strong></p><ul><li>JavaScript Client: <code>queen-mq</code> ≥0.7.4</li><li>Python Client: <code>queen-mq</code> ≥0.7.4</li></ul><h3 id="version-0-10-0" tabindex="-1">Version 0.10.0 <a class="header-anchor" href="#version-0-10-0" aria-label="Permalink to &quot;Version 0.10.0&quot;">​</a></h3><p><strong>Highlights:</strong></p><ul><li>Total rewrite of the engine with libuv and stored procedures, removed streaming engine</li></ul><p><strong>Compatible Clients:</strong></p><ul><li>JavaScript Client: <code>queen-mq</code> ≥0.7.4</li><li>Python Client: <code>queen-mq</code> ≥0.7.4</li></ul><h3 id="version-0-8-0" tabindex="-1">Version 0.8.0 <a class="header-anchor" href="#version-0-8-0" aria-label="Permalink to &quot;Version 0.8.0&quot;">​</a></h3><p><strong>Highlights:</strong></p><ul><li>Added Shared Cache with UDP sync for clustered deployment</li><li>Enables multi-server deployments to share state efficiently</li><li>Reduces database queries by 80-90% in clustered environments</li></ul><p><strong>Compatible Clients:</strong></p><ul><li>JavaScript Client: <code>queen-mq</code> ≥0.7.4</li><li>Python Client: <code>queen-mq</code> ≥0.7.4</li></ul><h3 id="version-0-7-5" tabindex="-1">Version 0.7.5 <a class="header-anchor" href="#version-0-7-5" aria-label="Permalink to &quot;Version 0.7.5&quot;">​</a></h3><p><strong>Highlights:</strong></p><ul><li>First stable release of Queen MQ</li><li>Full feature set including partitions, consumer groups, transactions, and streaming</li><li>Production-ready with comprehensive testing</li></ul><p><strong>Compatible Clients:</strong></p><ul><li>JavaScript Client: <code>queen-mq</code> ≥0.7.4</li><li>Python Client: <code>queen-mq</code> ≥0.7.4</li></ul><hr><h2 id="client-installation" tabindex="-1">Client Installation <a class="header-anchor" href="#client-installation" aria-label="Permalink to &quot;Client Installation&quot;">​</a></h2><p>Install the latest compatible clients:</p><p><strong>JavaScript:</strong></p><div class="language-bash vp-adaptive-theme line-numbers-mode"><button title="Copy Code" class="copy"></button><span class="lang">bash</span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span style="--shiki-light:#6F42C1;--shiki-dark:#B392F0;">npm</span><span style="--shiki-light:#032F62;--shiki-dark:#9ECBFF;"> install</span><span style="--shiki-light:#032F62;--shiki-dark:#9ECBFF;"> queen-mq</span></span></code></pre><div class="line-numbers-wrapper" aria-hidden="true"><span class="line-number">1</span><br></div></div><p><strong>Python:</strong></p><div class="language-bash vp-adaptive-theme line-numbers-mode"><button title="Copy Code" class="copy"></button><span class="lang">bash</span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span style="--shiki-light:#6F42C1;--shiki-dark:#B392F0;">pip</span><span style="--shiki-light:#032F62;--shiki-dark:#9ECBFF;"> install</span><span style="--shiki-light:#032F62;--shiki-dark:#9ECBFF;"> queen-mq</span></span></code></pre><div class="line-numbers-wrapper" aria-hidden="true"><span class="line-number">1</span><br></div></div>',42)])])}const g=t(n,[["render",r]]);export{p as __pageData,g as default};
